import React from 'react';
import IoT from './IoT.png'
import './Logo.css';
import Tilt from 'react-tilt';
import anime from 'animejs';

const Logo =()=>
{
	return(
    <div className='ma4 mt0'>
		<div className='ma4'>
		<Tilt className='Tilt'options={{ max : 45 }} style={{ height: 150, width: 150 }}>
      <div className="pa3"><img alt='logo' src={IoT}/></div>
		</Tilt>
		</div>
		<div>
    <p params={anime({
			targets: 'p',
      translateX: [
      { value: 100, duration: 1200 },
      { value: 0, duration: 800 }
      ],
     rotate: '1turn',
     backgroundColor: '#FFF',
     duration: 2000,
     loop: true
	 })} className='f2'>Internet of Things</p>
		</div>
    </div>

    );
}

export default Logo;
